import React from 'react';

function Card({ title, likesCount, link}) {
    return (
        <template id="card">
          <li className="element">
            <img className="element__image" src={link} alt={title} />
            <div className="element__container">
              <h2 className="element__title">{title}</h2>
              <div className="element__like-container">
                <button className="element__like-btn"></button>
                <span className="element__like-counter">{likesCount}</span>
              </div>
            </div>
            <button className="element__delete-btn"></button>
          </li>
        </template>
    )
}

export default Card;
